INSERT INTO `tnx` VALUES (4, '                  <h1><p style=\"margin-top: 16px; font-family: helvetica, arial; font-size: 16px;\"><span style=\"background-color: rgb(255, 255, 0);\">Kontrak Messi di Barcelona bakal habis pada Juni 2021. La Pulga belum kunjung menandatangani kontrak baru, yang sejauh ini dikabarkan ingin lebih dulu melihat perubahan situasi Barcelona.</span></p><p style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Messi sebetulnya sudah mau pergi dari Barcelona sejak akhir musim lalu. Di sisi lain, Barcelona tak kunjung mau melepas bintangnya itu secara cuma-cuma. Messi pada akhirnya mengalah untuk bertahan satu musim lagi.</p><p style=\"margin-top: 16px; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Kontrak Messi di Barcelona bakal habis pada Juni 2021. La Pulga belum kunjung menandatangani kontrak baru, yang sejauh ini dikabarkan ingin lebih dulu melihat perubahan situasi Barcelona.</p><p style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Messi sebetulnya sudah mau pergi dari Barcelona sejak akhir musim lalu. Di sisi lain, Barcelona tak kunjung mau melepas bintangnya itu secara cuma-cuma. Messi pada akhirnya mengalah untuk bertahan satu musim lagi.</p></h1>                ', NULL);
